import { userActionTypes } from '../User/User.Types'

export const setCurrentUser = (user) => {
    return{
        type: userActionTypes.SET_CURRENT_USER,
        payload: user
    }
}

export const googleSignInStart = () => {
    return{
        type: userActionTypes.LOGIN_WITH_GOOGLE_START
    }
}

export const googleSignInSuccess = (user) => {
    return{
        type: userActionTypes.LOGIN_WITH_GOOGLE_SUCCESS,
        payload: user
    }
}

export const googleSignInFailed = (error) => {
    return{
        type: userActionTypes.LOGIN_WITH_GOOGLE_FAILED,
        payload: error
    }
}

export const emailPassWordSignInStart = (emailPassword) => {
    return{
        type: userActionTypes.LOGIN_WITH_EMAIL_PASSWORD_START,
        payload: emailPassword
    }
}

export const emailPassWordSignInSuccess = (user) => {
    return{
        type: userActionTypes.LOGIN_WITH_EMAIL_PASSWORD_SUCCESS,
        payload: user
    }
}

export const emailPassWordSignInFailed = (error) => {
    return{
        type: userActionTypes.LOGIN_WITH_EMAIL_PASSWORD_FAILED,
        payload: error
    }
}
